import React, { useState, useEffect } from 'react';
import avatar from '../img/avatar.png';

import TerminalTwoToneIcon from '@mui/icons-material/TerminalTwoTone';
import DesignServicesTwoToneIcon from '@mui/icons-material/DesignServicesTwoTone';
import KeyboardDoubleArrowRightRoundedIcon from '@mui/icons-material/KeyboardDoubleArrowRightRounded';

const name = "IANNE FABIANO";

const Services = () => {

    const [activeSection, setActiveSection] = useState('0');

    const [dipslayText, setDisplayText] = useState('');
    const [currentIndex, setCurrentIndex] = useState(0);

    useEffect(() => {
        const typingInterval = setInterval(() => {
            if (currentIndex <= name.length) {
                setDisplayText(name.slice(0, currentIndex));
                setCurrentIndex((prevIndex) => prevIndex + 1);
            } else {
                clearInterval(typingInterval);
            }
        }, 300)
        return () => clearInterval(typingInterval);
    }, [currentIndex]);

    const scrollToSection = (id) => {
        const element = document.getElementById(id);
        if (element) {
            element.scrollIntoView({ behavior: 'smooth' });
        }
    };

    useEffect(() => {
        const handleScroll = () => {
            const sections = ['0', '1', '2', '3'];
            const scrollPosition = window.scrollY + 200;
            for (const section of sections) {
                const currentSection = document.getElementById(section);
                if (currentSection && scrollPosition >= currentSection.offsetTop && scrollPosition < currentSection.offsetTop + currentSection.offsetHeight) {
                    setActiveSection(section);
                }
            }
        };

        window.addEventListener('scroll', handleScroll);
        return () => window.removeEventListener('scroll', handleScroll);
    }, []);

    return (
        <div className="flex flex-col">
            <div className="h-fit grid md:grid-cols-2 gap-4">
                <div className='flex flex-col gap-2 justify-center'>
                    <p className='md:text-2xl text-xl font-semibold'>Hey there! I'm
                        <span className='text-primary font-bold md:text-2xl'>
                            <span className='hover:text-secondary hover:font-bold'> D</span>
                            <span className='hover:text-secondary hover:font-bold'>i</span>
                            <span className='hover:text-secondary hover:font-bold'>a</span>
                            <span className='hover:text-secondary hover:font-bold'>n</span>
                            <span className='hover:text-secondary hover:font-bold'>n</span>
                            <span className='hover:text-secondary hover:font-bold'>e</span>
                        </span>.
                    </p>
                    <p className='md:text-lg text-base'>I love creating elegant web experiences and captivating interfaces.</p>

                    <button onClick={() => scrollToSection('3')} className='flex font-medium text-primary hover:text-secondary'>
                        <KeyboardDoubleArrowRightRoundedIcon className='pb-1' />
                        <p>Let's collaborate!</p>
                    </button>
                </div>

                {/* <div>
                <img src={avatar} alt='Dianne Fabiano Animation' className='animate-bounce px-20' />
            </div> */}

            </div>
            <div className="pb-4 text-center font-medium text-lg">Here's what I <span className='font-bold'>LOVE</span> to do!</div>

            <div className="grid md:grid-cols-2 gap-4">

                <div className="p-4 shadow hover:shadow-md rounded-md flex flex-col bg-white/70">
                    <p className='text-secondary/80 font-medium text-base'>
                        <span><DesignServicesTwoToneIcon className='text-secondary' /> </span>
                        FRONTEND DEVELOPMENT</p>
                    <p className='px-4 text-balance'>
                        I love  crafting captivating user interfaces, bringing designs to life with code, and creating seamless interactive experiences that engage and inspire users.
                    </p>
                </div>

                <div className="p-4 shadow hover:shadow-md rounded-md flex flex-col bg-white/70">
                    <p className='text-secondary/80 font-medium text-base'>
                        <span><TerminalTwoToneIcon className='text-secondary' /> </span>
                        BACKEND DEVELOPMENT</p>
                    <p className='px-4 text-balance'>
                        I'm passionate about architecting systems, optimizing performance, and delving into databases and algorithms. Building scalable solutions and tackling intricate challenges truly energizes my work in backend development.
                    </p>

                </div>

            </div>

            <div className='p-4 shadow hover:shadow-md rounded-md flex flex-col bg-white/70 mt-4'>
                <p className='font-semibold text-base text-primary/90 text-center'>MY TECH STACK</p>
                
                <div className='flex flex-col gap-4 pt-2 md:text-sm'>
                    <div className='flex flex-wrap gap-3 justify-center'>
                        <p className='bg-bg2 px-2 py-1 rounded-lg font-medium'>JavaScript</p>
                        <p className='bg-bg2 px-2 py-1 rounded-lg font-medium'>HTML</p>
                        <p className='bg-bg2 px-2 py-1 rounded-lg font-medium'>CSS</p>
                        <p className='bg-bg2 px-2 py-1 rounded-lg font-medium'>TailwindCSS</p>
                        <p className='bg-bg2 px-2 py-1 rounded-lg font-medium'>Flask</p>
                        <p className='bg-bg2 px-2 py-1 rounded-lg font-medium'>React</p>
                        <p className='bg-bg2 px-2 py-1 rounded-lg font-medium'>MySQL</p>
                    </div>

                    <div className='flex flex-wrap gap-3 justify-center'>
                        <p className='bg-bg2/80 px-2 py-1 rounded-lg font-medium'>VS Code</p>
                        <p className='bg-bg2/80 px-2 py-1 rounded-lg font-medium'>Figma</p>
                        <p className='bg-bg2/80 px-2 py-1 rounded-lg font-medium'>GitHub</p>
                        <p className='bg-bg2/80 px-2 py-1 rounded-lg font-medium'>XAMPP</p>
                        <p className='bg-bg2/80 px-2 py-1 rounded-lg font-medium'>Docker</p>
                        <p className='bg-bg2/80 px-2 py-1 rounded-lg font-medium'>Ubuntu</p>
                    </div>
                </div>
                
            </div>
        </div>
    );
};

export default Services;
